import React from 'react'
import { Component } from 'react'
import fondmarin from './images/fondmarin.jpg'
import foret from './images/foret.jpg'
import montagne from './images/montagne.jpg'
import plage from './images/plage.jpg'
import ville from './images/ville.jpg'
import './Wishes.css'



class Wishes extends Component {
    constructor(props){
        super(props)
        this.state = {
          fondmarin : false,
          foret : false,
          montagne : false,
          plage : false,
          ville : false,
        }
      }


      render (){ 
        return (
            <div className="Wishes">
                <h1>Pendant cette période de confinement, il est difficile de s'évader.</h1> 
                <h1>Où voulez-vous vous échapper ?</h1>

                <div className="colonne">

                    <div className="ligne1">
                        <h2>Fonds Marins</h2>
                        <img className="photos" src={fondmarin} alt="Fonds Marins"/>

                        <h2>Forêt</h2>
                        <img className="photos" src={foret} alt="Forêt"/>

                        <h2>Montagne</h2>
                        <img className="photos" src={montagne} alt="Montagne"/>
                    </div>

                    <div className="ligne2">
                        <h2>Plage</h2>
                        <img className="photos" src={plage} alt="Plage"/>

                        <h2>Ville</h2>
                        <img className="photos" src={ville} alt="Ville"/>
                    </div>


                </div>
            </div>
        );
    }}


    export default Wishes;


